import{_ as e,c as r,o as t,a2 as o}from"./chunks/framework.BfF5VrUX.js";const u=JSON.parse('{"title":"代理設定說明","description":"","frontmatter":{},"headers":[],"relativePath":"zh/resource/ip.md","filePath":"zh/resource/ip.md"}'),p={name:"zh/resource/ip.md"};function l(n,a,s,i,h,c){return t(),r("div",null,[...a[0]||(a[0]=[o('<h1 id="代理設定說明" tabindex="-1">代理設定說明 <a class="header-anchor" href="#代理設定說明" aria-label="Permalink to &quot;代理設定說明&quot;">​</a></h1><h2 id="ip代理選購渠道" tabindex="-1">IP代理選購渠道 <a class="header-anchor" href="#ip代理選購渠道" aria-label="Permalink to &quot;IP代理選購渠道&quot;">​</a></h2><ul><li><a href="https://referral.ipfoxy.com/WhatsCRM" target="_blank" rel="noreferrer">ipfoxy</a></li><li>海外機場代理，這種代理機場很多，使用者可自行網上搜索。（平均價格極低特點，速度快的特點，但是節點是公共的，適合對IP要求不是非常嚴格的環境，適合海外客戶）</li></ul><p><strong>注意:中國大陸地區使用者，需要購買合法的海外專線，將本地網路代理到海外環境，才可使用以上第三方代理，目前伊叡行銷有推薦的海外專線代理服務商，合法合規，速度測試穩定</strong></p><p>可透過伊叡行銷官方客服獲取推薦的海外專線</p><h2 id="代理資訊匯入伊叡行銷" tabindex="-1">代理資訊匯入伊叡行銷 <a class="header-anchor" href="#代理資訊匯入伊叡行銷" aria-label="Permalink to &quot;代理資訊匯入伊叡行銷&quot;">​</a></h2><blockquote><p>目前伊叡行銷系統的代理自動匯入功能全部合併為一個統一的入口，使用者中心-》代理-》代理資訊自動匯入</p></blockquote><h3 id="常規代理匯入方式" tabindex="-1">常規代理匯入方式 <a class="header-anchor" href="#常規代理匯入方式" aria-label="Permalink to &quot;常規代理匯入方式&quot;">​</a></h3><p>常規代理一般是http，socks5這種形式，下面以ipfoxy為例影片說明如何匯入代理到伊叡行銷</p><p><a href="https://youtu.be/DO9ovrOfD7g" target="_blank" rel="noreferrer">影片演示(Youtube)</a></p><h3 id="海外機場代理匯入方式" tabindex="-1">海外機場代理匯入方式 <a class="header-anchor" href="#海外機場代理匯入方式" aria-label="Permalink to &quot;海外機場代理匯入方式&quot;">​</a></h3><p>將機場的訂閱連結匯入Clash中，複製Clash配置檔案再透過伊叡行銷的代理資訊自動匯入功能一鍵匯入Clash配置檔案內容的所有代理，相對其它的方式，價效比是最高的，一般情況下速度也是相對較快的，很多第三方代理配置檔案不規範導致匯入失敗，這時可以把配置檔案發給客服，客服這邊矯正一下之後，您再匯入</p><p><a href="https://youtu.be/-U3MLMhUR98" target="_blank" rel="noreferrer">影片演示(YouTube)</a></p><h2 id="什麼是前置代理和目標代理" tabindex="-1">什麼是前置代理和目標代理 <a class="header-anchor" href="#什麼是前置代理和目標代理" aria-label="Permalink to &quot;什麼是前置代理和目標代理&quot;">​</a></h2><p>當建立指紋瀏覽器或者給Android手機裝置設定代理的時候，伊叡行銷的設定介面會顯示<strong>前置代理</strong>和<strong>目標代理</strong>兩個設定項</p><p>假設您在伊叡行銷中已設定有5個代理，IP1,IP2,IP3,IP4,IP5</p><p>此時您想建立指紋瀏覽器使用IP5去訪問Facebook，您在目標代理中選擇IP5</p><p>但是此時您本地網路訪問IP5比較慢，或者訪問不了，但是您本地網路可正常訪問IP1,IP2,IP3,IP4</p><p>此時您可以將此指紋瀏覽器的前置代理設定為IP1,IP2,IP3,IP4</p><p>這時您的網路訪問途徑是</p><p>本機-&gt;(IP1,IP2,IP3,IP4)系統自動選擇一個比較快的代理-&gt;IP5-&gt;Facebook</p><p>以上您可以發現<strong>前置代理</strong>其實就是起到一個代理中轉的作用，解決某些情況下本地網路直接訪問<strong>目標代理</strong>比較慢的情況，增強穩定性</p>',22)])])}const d=e(p,[["render",l]]);export{u as __pageData,d as default};
